/**
 * return the probability of being less or equal to p for the Krikun distribution conditionned on being non zero.
**/
inline double CDF_Krikun_posi(unsigned int p)
    {
    if (p < 5001) {return KRIKUNLAW_TAB[p];}
    double x = (double)p;
    return(1.0 - (1.1965351714172/(x*sqrt(x))));
    }



/**
 * return the probability of being less or equal to p for the Krikun distribution conditionned on being non-zero              
**/
inline double CDF_Krikun(unsigned int p)
    {
	return((CDF_Krikun_posi(p)+ 2.0)/3.0);
    }


/**
 * convert a double in [0,1) into an integer according to the krikun distribution conditionned on being non zero                                                  *
**/
inline unsigned int KrikunLaw_posi(double a)
    {
    if (a >= KRIKUNLAW_TAB[5000])
        {
        double v = 1.1965351714172/(1-a);
        v = pow(v,2.0/3.0);
        return(((unsigned int)v)+1);
        }
    unsigned int p = 1;
    while(1)
        {
        if (a < KRIKUNLAW_TAB[p]) {return(p);}
        p++;
        }
    }



/**
 * convert a double in [0,1) into an integer according to the krikun distribution        
**/
inline unsigned int KrikunLaw(double a)
    {
	a = a*3.0;
	if (a < 1.0) {return KrikunLaw_posi(a);} else {return 0;}
    }


